@枪枪腔II 到洛杉矶出差。周末飞过来找我玩啦！✈️

从一顿美美的brunch开启硅谷一日游（准确来说是半日，因为我们都睡懒觉了[笑cry]）。真的是从见上面就开始一刻不停的讲话，讲了好多好多好多话，也走了好多好多路，晒了好多好多加州阳光！
好好看的一天噢，又彩色又青春[微风]我觉得我们俩也很好看 ​

