      我们生于红旗之下，生长于春风之中。以青春之名，书写清澈挚爱；以心中红星，献礼中华。人民有信仰，国家有力量，民族有希望。目光所至皆为华夏，五星闪耀皆为信仰。如果信仰有颜色，那一定是中国红。

